export default function NewBoard() {

const rows = [];
let n = 1;

for (let i=0; 1 < 3; i++) {
  const buttons = [];
  for (let j=0; j < 3; j++) {
    buttons.push(
      <button className="square">L</button>
    )
  }

  rows.push(
    <div className="board-row">
      {buttons}
    </div>
  )
}

return <>{rows}</>;

}


